function Contacts(props) {

  return (
    <div className="Contacts">
        <h2>Contacts</h2>
        {props.friends && props.friends.map((item,i)=>{return <div key={i}>{ item.first_name + " " + item.last_name }</div>})}
    </div>
  );
}

export default Contacts;
